import React from "react";
import './login.css';
import fetchdata  from "../api/backlogin";
function Login() {
    let a,b;
    let onchan=(e)=>{
        a=e.target.value;
        console.log(a);
    }
    let onpass=(e)=>{
        b=e.target.value;
        console.log(b);
    }


    return (
      <div className="Login">
        <form className="login-form">
          <div className="form-group">
            <label htmlFor="username">Username</label>
            <input type="text" id="username" name="username" onChange={onchan}/>
          </div>
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input type="password" id="password" name="password" onChange={onpass} />
          </div>
          <button type="submit" className="login-button" onClick={fetchdata(a,b)}>Login</button>
        </form>
      </div>
    );
  }

export default Login;
